import React, { useState } from "react";
import { logout } from "../utils/auth";
import { useNavigate } from "react-router-dom";

const sampleData = [
  { id: 1, name: "Cliente 1", ativo: true },
  { id: 2, name: "Cliente 2", ativo: false },
  { id: 3, name: "Cliente 3", ativo: true },
  { id: 4, name: "Cliente 4", ativo: true },
  { id: 5, name: "Cliente 5", ativo: false },
];

function Dashboard() {
  const navigate = useNavigate();
  const [data] = useState(sampleData);

  const handleLogout = async () => {
    await logout();
    navigate("/");
  };

  const handleViewDetails = (id) => {
    navigate(`/details/${id}`);
  };

  return (
    <div className="dashboard-container">
      <h1>Dashboard</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Nome</th>
            <th>Ativo</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.name}</td>
              <td>{item.ativo ? "Sim" : "Não"}</td>
              <td>
                <button onClick={() => handleViewDetails(item.id)}>Ver Detalhes</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <button onClick={handleLogout} className="logout-button">Logout</button>
    </div>
  );
}

export default Dashboard;
